export function add25(a: number, b: number): number {
  return a + b;
}

export function subtract25(a: number, b: number): number {
  return a - b;
}

export function multiply25(a: number, b: number): number {
  return a * b;
}

export function divide25(a: number, b: number): number {
  return a / b;
}
